import React from 'react'
import Link from 'next/link';

const indexPage = () =>(
    <div>
        <h1>Welcome to my Site!</h1>
        <p>Go to <Link href='/auth'><a>Auth</a></Link></p>
            {/* must include anchor tag within Link tag */}
    </div>
);

export default indexPage;
